import { Row, Col, Button, Layout } from 'antd';
import { useNavigate } from 'react-router-dom';
import './Home.css';
const { Header, Footer, Sider, Content } = Layout;

function Home() {
  const navigate = useNavigate();
  return (
    <Layout>
      <Header>
        <Row style={{ width: '100%' }}>
          <Col offset={3}>
            <h1 onClick={() => navigate('/')}>PorscheRestaurant</h1>
          </Col>
          <Col offset={16}>
            <Button type="danger" onClick={() => navigate('/login')}>
              APP
            </Button>
          </Col>
        </Row>
      </Header>
      <Content style={{ height: '80vh' }}>CCC</Content>
      <Footer>Footer</Footer>
    </Layout>
  );
}

export default Home;
